exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.dongliuxiaoshuo.com/read/${bid}.html`,{cleaner:html=>cleanCatalogWrapper(html,/section class="[^"]*booklist"[^>]*>/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};